import Link from 'next/link';
import { Button } from 'antd';
import Container from './_app';

const Index: React.FC = () => {

    console.log('component Index reander..');

    return (
        <Container Component={Page} pageProps={{}} />
    )
}

const Page: React.FC = () => {
    return 
        <Link href='/home'>
            <Button>你好</Button>
        </Link>
    
}



export default Index;
